      </div>
      <div id="home-text">
        <p>Stressed?</p>
        <p>Disorganised?</p>
        <p>Need Support?</p>
        <button>We got you.</button>
      </div>
      <style jsx>{`
        #home-title { height: 90vh; position: inline; float: left; }
        #home-text { height: 90vh; position: inline; float: right; }
        h1 { font-family: Raleway; font-size: 15vw; }
        p { font-family: Montserrat; font-size: 3vw; }        
      `}</style>

      <HomeBody />

    </div>
  );
}
